let navBarElements = [
    {nombre: "Inicio"},
    {nombre: "Productos"},
    {nombre: "Carrito"}]

function NavBarItems() {
    return (
        navBarElements.forEach(element => <Nav.link>${element.nombre}</Nav.link>)
    )
}

export default NavBarItems
